import React, { Component } from 'react';

export default class Movie extends Component {
    render(){
        const { Poster, Title, Year, imdbID, Type} = this.props;
        return (
            <div>
                <div>{Poster}</div>
                <div>Name: {Title}</div>
                <div>Year: {Year}</div>
                <div>imdbID: {imdbID}</div>
                <div>Type: {Type}</div>
            </div>
        );
    }
}
